import React ,{memo} from 'react'

import Image from '../atoms/Image';
import Card from '../molecules/Card';
import axios from 'axios';
import useSWR from 'swr';
import FlexTemplate from '../templates/FlexTemplate';
const Home = memo(()=>{

    const CLIENT_ID = '0Z-LBq4hNinGRglNGQpYef33VyodRl1K012Ai9dJd18';
    const URL = `https://api.unsplash.com/photos?page=1&per_page=10&client_id=${CLIENT_ID}`

    const {data} = useSWR(URL,(url:string)=>axios(url).then(res=>res.data));

return(

<FlexTemplate>
{data && data?.forEach(((item: any)=>{


    <Card>
    <Image href={item.urls.regular} height={400} width={300}/>
</Card>


}))}



</FlexTemplate>
)
})
export default Home;
